import { feedbackDataApi, feedbackFromApi } from '@/api/kefu';
export default {
    name: "feedback",
    props: {
        change: Boolean
    },
    data() {
        return {
            loading:false,
            isShow: false,
            formItem: {
                rela_name: '',
                content: '',
                phone: ''
            },
            notice: '',
            ruleValidate: {
                rela_name: [
                    { required: true, message: '请输入您的姓名', trigger: 'blur' }
                ],
                content: [
                    { required: true, message: '请输入留言内容', trigger: 'blur' }
                ],
                phone: [
                    { required: true, message: '请填写手机号码', trigger: 'change' },
                    { pattern: /^1[3456789]\d{9}$/, message: "手机号码格式不正确", trigger: "blur" }
                ]
            }
        }
    },
    mounted() {
        this.getNotice();
    },
    methods: {
        handleSubmit (name) {
            this.loading = true
            this.$refs[name].validate((valid) => {
                if (valid) {
                    feedbackFromApi(this.formItem).then((res) => {
                        this.loading = false
                        this.isShow = true;
                    }).cache(err => {
                        this.loading = false
                        this.$Message.error(err.msg);
                    });
                } else {

                }
            })
        },
        close: function () {
            this.$emit("closeChange", false);
        },
        // 广告
        getNotice() {
            feedbackDataApi().then((res) => {
                this.notice = res.data.feedback;
            }).cache(err => {
                this.$Message.error(err.msg);
            });
        },
    }
}
